import React from "react";

export default function Color() {
 
    return(
 
      <div className="color-page">

        <div className="color-title">
            <h4>Color Utilities</h4>
            <p>Bootstrap's default utility classes can be found on the official <span></span>. The custom utilities below were created to extend this theme past the default utility classes built into Bootstrap's framework.</p>
        </div>










      </div>







    );
}
